&quot;IMAGINE A WORLD WITHOUT SHERLOCK&quot; - Moriarty Offers a New Take on Literatures 
Original Super-Villain. It is the dawn of World War I, and Sherlock Holmes has 
been dead for 20 years. 

Holmes enemy - Professor James Moriarty - is a lost man. MI5 blackmails 
Moriarty into finding Holmes long-lost brother, Mycroft, but what at first 
appears to be a routine case leads to a web of intrigue that involves a 
psychic box and its creator, a woman from Moriartys past, and a new 
villain that threatens to be greater than Moriarty ever was!

